WOMT_aTexte['popup_faq_1_frage']=new Array();
WOMT_aTexte['popup_faq_1_frage'][0]='Nach welchen Kriterien werden die Parteien f√ºr den Wahl-O-Mat ausgesucht?';
WOMT_aTexte['popup_faq_1_text']=new Array();
WOMT_aTexte['popup_faq_1_text'][0]='Die Bundeszentrale f√ºr politische Bildung/bpb hat alle Parteien und politischen Vereinigungen, die vom der Landeswahlleiterin in Nordrhein-Westfalen zur Landtagswahl 2010 zugelassen wurden, zur Teilnahme am Wahl-O-Mat eingeladen. Eine informative √úbersicht aller zugelassenen Parteien finden Sie auf <a tabindex="16" title="Wer steht zur Wahl? (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">www.werstehtzurwahl.de</a>.<br/><br/>Alle 25 zugelassenen Parteien haben die Thesen bis zum Redaktionsschluss am 26. M√§rz 2010 beantwortet. Grunds√§tzlich gilt als Kriterium, dass alle Parteien und politischen Vereinigungen am Wahl-O-Mat teilnehmen d√ºrfen, die von der Landeswahlleiterin zugelassen werden. Es werden also keine Einzelkandidaten und sonstige politischen Vereinigungen aufgenommen, die nur in einem oder wenigen Wahlkreisen antreten. Somit k√∂nnen aber auch Parteien im Wahl-O-Mat auftauchen, die vom Verfassungsschutz des Bundes oder der L√§nder beobachten werden und als "extremistisch" eingestuft werden. Welche Parteien als extremistisch eingestuft werden, k√∂nnen Sie auf den Seiten des Verfassungsschutzes nachlesen: <a tabindex="17" title="Verfassungsschutzbericht NRW 2009 (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.im.nrw.de/sch/29.htm" target="_blank">Verfassungsschutzbericht NRW 2009</a>. Zus√§tzlich kommt die bpb dem Informationsbed√ºrfnis √ºber alle zur Wahl zugelassenen Parteien und W√§hlervereinigungen auch weiterhin durch das Online-Angebot <a tabindex="18" title="Wer steht zur Wahl? (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">"Wer steht zur Wahl?"</a> nach.';
WOMT_aTexte['xxx_dummy9']=new Array();
WOMT_aTexte['xxx_dummy9'][0]=' ';
WOMT_aTexte['popup_faq_9_text']=new Array();
WOMT_aTexte['popup_faq_9_text'][0]='Der Wahl-O-Mat ist ein Angebot zur politischen Bildung und Information - und keine Wahlempfehlung. Er m√∂chte zum einen wichtige Fragen der Landtagswahl vorstellen und zum anderen die Auseinandersetzung des Users mit den zur Wahl zugelassenen Parteien unterst√ºtzen.¬†Daher liegt in der Handhabung der Fokus auf der inhaltlichen Auseinandersetzung mit den einzelnen Thesen sowie mit den Parteien und deren Positionen. <br/><br/>Dazu geh√∂rt auch, dass die User zun√§chst eigenverantwortlich eine Entscheidung dar√ºber treffen, welche Parteien f√ºr sie von Interesse sind und sie zur Berechnung des Vergleichs ausw√§hlen wollen.<br/><br/>Sie k√∂nnen bis zu acht Parteien gleichzeitig ausw√§hlen, mit denen Sie Ihre eigene Positionen vergleichen m√∂chten. Die Reihenfolge der Parteien auf dieser Wahl-O-Mat-Seite richtet sich nach der Reihenfolge auf dem Stimmzettel. Keine der Parteien wurde im Wahl-O-Mat vorab ausgew√§hlt. Die Auswahl obliegt allein dem User.<br/><br/>Der Wahl-O-Mat richtet sich zudem insbesondere an Politik-Neulinge und Erst- und Jungw√§hler. Hier ist es besonders wichtig, zum einen die eigenst√§ndige und bewusste Auseinandersetzung zu f√∂rdern, zum anderen aber auch die Ergebnisse m√∂glichst √ºbersichtlich, klar strukturiert und leicht verst√§ndlich darzustellen. Dieses Ziel l√§sst sich mit einer selbst gew√§hlten und immer wieder neu auszuw√§hlenden begrenzten Anzeige der Parteien besser erreichen, als ein Wahl-O-Mat Ergebnis aller Einzelvoten im Vergleich mit allen 25 Parteien zu jeweils 38 Thesen.<br/><br/>Damit Sie sich einen √úberblick √ºber alle 25 Parteien verschaffen k√∂nnen, hat die bpb zus√§tzlich auf der Parteien-Auswahl-Seite¬†im Wahl-O-Mat hinter jeder Partei ein Parteienprofil des bpb-Angebots "Wer steht zur Wahl" (<a tabindex="56" title="Wer steht zur Wahl? (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">www.werstehtzurwahl.de</a>) verlinkt.¬†So k√∂nnen Sie sich kurze Informationen √ºber alle zur Wahl zugelassenen 25 Parteien einholen und besonders √ºber viele der kleineren Parteien mehr erfahren.<br/><br/>Dennoch k√∂nnen Sie Ihre Position mit allen 25 Parteien im Wahl-O-Mat vergleichen:<br/><br/>- W√§hlen Sie einfach unter der ersten Auswertung den Link zur "Zur√ºck zur Parteienauswahl" und w√§hlen Sie erneut acht Parteien aus - ohne dabei alle 38 Thesen neu beantworten zu m√ºssen.<br/><br/>- Oder vergleichen Sie Ihre Position mit allen 25 Parteien auf einer √úbersicht aller 25 Parteiantworten als PDF auf der Seite "Ihr Wahl-O-Mat Ergebnis".';
WOMT_aTexte['popup_faq_2_frage']=new Array();
WOMT_aTexte['popup_faq_2_frage'][0]='Wie ist der Wahl-O-Mat entwickelt worden? Sind die Parteien und W√§hlervereinigungen daran beteiligt gewesen?';
WOMT_aTexte['popup_faq_2_text']=new Array();
WOMT_aTexte['popup_faq_2_text'][0]='Der Wahl-O-Mat ist in Deutschland erstmals zur Bundestagswahl 2002 eingesetzt worden. Er wurde von einer unabh√§ngigen Redaktion, die aus jungen Erwachsenen besteht, in Kooperation mit der Bundeszentrale f√ºr politische Bildung/bpb und mit Unterst√ºtzung ihrer Partner und des niederl√§ndischen Instituut voor Publiek en Politiek (Institut f√ºr √ñffentlichkeit und Politik - IPP) entwickelt. Dabei ging der Wahl-O-Mat aus dem StemWijzer hervor. Das ist ein vom IPP entwickelter Test, mit dem Sie feststellen k√∂nnen, wie Sie pers√∂nlich zu den Zielen und Positionen von Parteien stehen. Dieser Test geh√∂rt in den Niederlanden seit langem fest zum Vorwahlgeschehen. Bei der Bundestagswahl 2002 wurde der Wahl-O-Mat √ºber 3,6 Millionen mal gespielt. Seitdem wurde er von der bpb bei √ºber zehn Landtagswahlen, sowie den Europawahlen 2004 und 2009 eingesetzt. Zur Europawahl 2009 wurde er mehr als 1,5 Millionen, zur Bundestagswahl 2009 √ºber 6,7 Millionen Mal gespielt. Insgesamt hatte der Wahl-O-Mat seit 2002 bereits √ºber 18 Millionen Nutzungen.<br/><br/>Die Redaktion des Wahl-O-Mat f√ºr die Landtagswahl 2010 in Nordrhein-Westfalen bestand aus insgesamt 20 jungen Menschen aus ganz Nordrhein Westfalen, unterst√ºtzt von Wissenschaftlern und Experten sowie der bpb, der Landeszentrale f√ºr politische Bildung Nordrhein-Westfalen und dem Landesjugendring Nordrhein-Westfalen. In drei Workshops hat die Redaktion die Thesen des Wahl-O-Mat entwickelt und formuliert. Den Parteien und sonstigen politischen Vereinigungen wurde eine Liste mit insgesamt 86 Thesen zugeschickt. Sie wurden gebeten, die Thesen entsprechend der Parteihaltung mit "stimme zu", "stimme nicht zu" oder "neutral" zu beantworten. Aus den ausgef√ºllten Listen wurden diejenigen Thesen rechnerisch ermittelt, die keine ausreichende Unterscheidung der Parteien und W√§hlervereinigungen m√∂glich machten, und entfernt. Die Redaktion hat aus den verbleibenden eine endg√ºltige Auswahl von 38 Thesen getroffen, die in den Wahl-O-Mat eingebunden wurden. Die Parteien und W√§hlervereinigungen waren an der Endauswahl der Thesen nicht beteiligt. Mehr zum Entstehungsprozess eines Wahl-O-Mat finden Sie in unserem <a tabindex="24" title="Making of (Dieser Link √∂ffnet sich in einem neuen Fenster.)" target="_blank" class="link_normal" href="http://www.bpb.de/methodik/AN79O6">"Making of"</a>.';
WOMT_aTexte['popup_faq_3_frage']=new Array();
WOMT_aTexte['popup_faq_3_frage'][0]='Wieso kommen manche wichtige Themen im Wahl-O-Mat nicht zur Sprache?';
WOMT_aTexte['popup_faq_3_text']=new Array();
WOMT_aTexte['popup_faq_3_text'][0]='Das ist eine schwierige Frage. Wer entscheidet, welche Themen wichtig sind und welche nicht? Die Regierung, die Parteien, die Medien und die B√ºrgerinnen und B√ºrger haben dazu sehr unterschiedliche Meinungen. Bei der Auswahl der Thesen f√ºr unseren Wahl-O-Mat bezogen wir uns vor allem auf jene Themen, zu denen die Parteien und W√§hlervereinigungen unterschiedliche Meinungen haben und auf jene, die besonders auch f√ºr junge Leute von Interesse sind. Leider sind w√§hrend des Entstehungsprozesses auch "gute" Thesen aus dem Wahl-O-Mat gefallen. Dies kam vor, weil Thesen von einzelnen Parteien nicht eindeutig mit stimme zu / stimme nicht zu / neutral beantwortet wurden oder weil die Parteipositionen in dieser These keine Unterscheidung zwischen den Parteien und W√§hlervereinigungen erm√∂glichten. Wir haben Interesse an Ihrer Meinung. Schicken Sie uns Ihre √úberlegungen zu, am besten unter: <a tabindex="26" title="" class="link_normal" href="mailto:info@wahl-o-mat.de">info@wahl-o-mat.de</a>';
WOMT_aTexte['popup_faq_5_frage']=new Array();
WOMT_aTexte['popup_faq_5_frage'][0]='Was mache ich, wenn ich zu einem Thema nichts angeben m√∂chte?';
WOMT_aTexte['popup_faq_5_text']=new Array();
WOMT_aTexte['popup_faq_5_text'][0]='Dann enthalten Sie sich Ihrer Stimme und klicken auf "These √ºberspringen". Diese Aussage wird dann beim Ergebnis nicht ber√ºcksichtigt. Letzteres sollten Sie aber nicht zu oft machen, denn wenn zu oft "√ºberspringen" geklickt wird, kann auch kein zuverl√§ssiges Ergebnis errechnet werden. Sie haben jedoch auch die M√∂glichkeit, jederzeit wieder zu einer These zur√ºckzukehren, um sie doch noch zu beantworten.';
WOMT_aTexte['popup_faq_6_frage']=new Array();
WOMT_aTexte['popup_faq_6_frage'][0]='Wie ist es m√∂glich, dass ich als Ergebnis die Partei erhalte, die ich √ºberhaupt nicht erwartet habe?';
WOMT_aTexte['popup_faq_6_text']=new Array();
WOMT_aTexte['popup_faq_6_text'][0]='Das wissen wir nat√ºrlich auch nicht. Bitte erwarten Sie von uns kein Urteil dar√ºber, was eine "gute" oder eine "schlechte" Partei oder W√§hlervereinigung ist. In unserer Nutzerbefragung zum Wahl-O-Mat erfuhren wir, dass der Wahl-O-Mat bei etwa 10% der Nutzer ein √ºberraschende Ergebnisse aufweist. Das von Ihnen ermittelte Wahl-O-Mat Ergebnis ist eben ein Durchschnittsergebnis aus vielen Themengebieten. Es kann also sein, dass Sie bei einem Themengebiet die Meinung der Partei oder W√§hlervereinigung, der Sie bisher am nahesten standen, treffen, aber im Wahl-O-Mat Gesamtergebnis noch besser mit einer anderen Partei oder W√§hlervereinigung √ºbereinstimmen. Ber√ºcksichtigt werden muss au√üerdem, dass sich das Ergebnis des Wahl-O-Mat eben nur auf die bereitgestellte Thesenauswahl bezieht. Sicher gibt es auch weitere gute Gr√ºnde, sich der einen oder anderen Partei oder W√§hlervereinigung nahe zu f√ºhlen. Wir finden, dass dies eine gute Gelegenheit ist, sich mit den eigenen politischen Positionen und denen der Parteien und W√§hlervereinigungen auseinander zu setzen. Schauen Sie doch einfach mal auf die Webseiten der Parteien.';
WOMT_aTexte['popup_faq_7_frage']=new Array();
