WOMT_aTexte['popup_faq_7_text']=new Array();
WOMT_aTexte['popup_faq_7_text'][0]='Es werden nur die Parteien in die Berechnung des Ergebnisses aufgenommen, die Sie vorher ausgew√§hlt haben. √úbereinstimmungen h√§ngen damit zusammen, dass die Mehrzahl der Thesen sachpolitische Themen zur Landtagswahl  anspricht. Bei diesen Thesen k√∂nnen extremistische Parteien Positionen vertreten, die mit denen anderer Parteien identisch sind. Bei einigen weiteren Thesen werden die Unterschiede zwischen diesen Parteien deutlich. Bitte schauen Sie sich entsprechend in der Darstellung auf der Ergebnisseite an, wie die als extremistisch eingestuften Parteien speziell bei diesen Thesen geantwortet haben. Welche Parteien als extremistisch eingestuft werden, k√∂nnen Sie auf den Seiten des Verfassungsschutzes nachlesen: <a tabindex="47" title="Verfassungsschutzbericht NRW 2009 (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.im.nrw.de/sch/29.htm" target="_blank">Verfassungsschutzbericht NRW 2009</a>. Einen informativen √úberblick √ºber alle zur Wahl zugelassenen Parteien finden Sie unter dem bpb-Angebot "Wer steht zur Wahl", <a tabindex="48" title="Wer steht zur Wahl? (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">www.werstehtzurwahl.de</a>.<br/>';
